import ChatBox from "../../components/chat/chatBox";
import ContactBox from "../../components/chat/contactBox";
import "./style.css";

export default function Chat() {
  return (
    <div className="blur">
      <div className="chat">
        <ContactBox />
        <ChatBox />
      </div>
    </div>
  );
}
